import logo from './logo.svg';
import './App.css';



function App() {
  return (
    <div className="App">
      
      <nav className="navbar navbar-dark bg-dark">
        <a href="" className="text-white">
          {this.props.titulo}
        </a>
      </nav>
      

      <img src={logo} className="App-logo" alt="logo" />
      
     
    </div>
  );
}

export default App;
